tables.table_schema:
CREATE TABLE MaintenanceSchedule (
    schedule_id UUID PRIMARY KEY,
    turbine_id UUID REFERENCES WindTurbine(turbine_id),
    scheduled_date DATE,
    description TEXT
);

CREATE TABLE Technicians (
  id INT PRIMARY KEY,
  name VARCHAR(50),
  specialization VARCHAR(50),
  hire_date DATE
);

CREATE TABLE WindTurbine (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    model VARCHAR(255),
    last_maintenance_date DATE
);

CREATE TABLE EnergyProduction (
    production_id INT PRIMARY KEY,
    turbine_id INT,
    production_date DATE,
    production_value DECIMAL(15,2)
);

CREATE TABLE MaintenanceTeam (
    team_id INT PRIMARY KEY,
    team_name VARCHAR(255),
    location VARCHAR(255)
);
